SERVIÇO DE ELABORAÇÃO DE ESTUDOS E PROJETOS DE ENGENHARIA PARA EXECUÇÃO DE SERVIÇOS A SEREM REALIZADOS NAS DEPENDÊNCIAS DO ED. SEDE DO ME/ES, ABRANGENDO:

1.1) ELABORAÇÃO DE PROJETO EXECUTIVO DE ENGENHARIA DE VIABILIDADE DE INSTALAÇÃO DE UMA USINA SOLAR COM PAINÉIS SOLARES NA ÁREA DO ESTACIONAMENTO PRINCESA ISABEL - AV. PRINCESA ISABEL - CENTRO - VITÓRIA-ES;

1.2) ELABORAÇÃO DE PROJETO EXECUTIVO DE ENGENHARIA DE ADEQUAÇÃO, PAVIMENTAÇÃO, ILUMINAÇÃO, MODERNIZAÇÃO, PAISAGISMO COM AMPLIAÇÃO DE VAGAS, NO QUE COUBER, DO PÁTIO DO ESTACIONAMENTO DO ED. SEDE DO ME - R. JOSUÉ PRADO, CENTRO - VITÓRIA-ES;

1.3) ELABORAÇÃO DE PROJETO EXECUTIVO DE ENGENHARIA DE INSTALAÇÃO DE DUTOS TIPO OVAL GIROVAL, ISOLADO, TÉRMICO, ESPIRAL, EM AÇO GALVANIZADO, COM SISTEMA DE DISTRIBUIÇÃO POR DIFUSORES COM REGISTRO, COM CERTIFICAÇÃO ISO 9001 PARA O SISTEMA DE AR REFRIGERADO DA CENTRAL DE ÁGUA GELADA (CAG) DO ED. SEDE DO ME - R. JOSUÉ PRADO, CENTRO - VITÓRIA-ES;

1.4) ELABORAÇÃO DE PROJETO EXECUTIVO DE ENGENHARIA DA ANÁLISE DA FUNDAÇÃO E ESTRUTURA SUBTERRÂNEA DA ÁREA DO HALL DOS ELEVADORES DO DO ED. SEDE DO ME - R. JOSUÉ PRADO, CENTRO - VITÓRIA-ES;

1.5) ELABORAÇÃO DE PROJETO EXECUTIVO DE ENGENHARIA DE INSTALAÇÃO DE RETROFIT MEDIANTE EMPREGO DE PERFIS DE ALUMÍNIO COM SISTEMA DE VEDAÇÃO CONTRA ÁGUA E VENTO NO PADRÃO EXISTENTE A SEREM INSTALADOS NA FACHADA ENVIDRAÇADA FRENTE E FUNDOS E ANEXO DO ED. SEDE DO ME - R. JOSUÉ PRADO, CENTRO - VITÓRIA-ES.
